import React, { Component } from 'react';
import axios from 'axios';

class Register extends Component {
    constructor(props) {
        super(props);
        this.state = {
            user_reg: {
                username: '',
                email: '',
                password: '',
            }
        }
        this.handleChange = this.handleChange.bind(this);
        this.handleSubmit = this.handleSubmit.bind(this);
    }

    handleChange = (e) => {
        this.setState({ [e.target.name]: e.target.value });
    }

    handleSubmit(event) {
        event.preventDefault();
        const user = this.state.user_reg;
        console.log(user)
    }

    render() {
        const { username, email, password } = this.state.user_reg;
        return (
            <div>
                <form onSubmit={this.handleSubmit}>
                    <input defaultValue={email} name="email" onChange={this.handleChange} placeholder="enter email" type="email"></input>
                    <input defaultValue={username} name="username" onChange={this.handleChange} placeholder="enter username" type="text"></input>
                    <input defaultValue={password} name="password" onChange={this.handleChange} placeholder="enter password" type="password"></input>
                    <button type="submit">Sign Up</button>
                </form>
            </div>
        );
    }
}

export default Register;
